import About from "./About";
import "react-router-dom";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function Nav() {
  return (
    <nav>
      <h3>Logo</h3>
      <ul>
        <li>Portfolio</li>
        <li>About</li>
      </ul>
    </nav>
  );
}

export default Nav;
